import React from "react";
import "bootstrap/dist/js/bootstrap.min.css ";
import "./navbar.css";
import MainNavBarIcon from './Images/NavBarIcon.png';

export function MainNavBar(){
    return(
        <>
            <nav class="navbar navbar-expand-lg navbar-light bg-light">
            <a class="navbar-brand" href="#"><img src={MainNavBarIcon} alt="no images found" width="180"/></a>
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
                <div class="navbar-nav">
                <a class="nav-link active" href="#">Home</a>
                <a class="nav-link active" href="#">About</a>
                <a class="nav-link active" href="#">Certificate</a>
                <a class="nav-link active" href="#">Education</a>
                <a class="nav-link active" href="#">Technical Skill</a>
                <a class="nav-link active" href="#">Contact</a>
                </div>
            </div>
            </nav>
        </>
    );
}
